import React, { Component } from 'react'
import { NavLink, animateScroll as scroll } from "react-scroll";
import {
    MDBNavbar,
    MDBNavbarBrand,
    MDBNavbarNav,
    MDBNavItem,
    MDBNavLink,
    MDBNavbarToggler,
    MDBCollapse,
    MDBBtn,
    MDBContainer,
    MDBDropdown,
    MDBDropdownToggle, 
    MDBDropdownMenu, 
    MDBDropdownItem
  } from "mdbreact";
export default class NavbarPage extends Component {
    state = {
        collapsed: false
      };
    
      handleTogglerClick = () => {
        this.setState({
          collapsed: !this.state.collapsed
        });
      };
      scrollToTop = () => {
        scroll.scrollToTop();
      };
    render() {
        const overlay = (
            <div
              id="sidenav-overlay"
              style={{ backgroundColor: "transparent" }}
              onClick={this.handleTogglerClick}
            />
          );
        return (
            <div>
            <MDBNavbar
              color="primary-color"
              dark
              expand="md"
              fixed="top"
              scrolling
              transparent
              id="navbar"
            >
              <MDBContainer>
                <MDBNavbarBrand>
                  <MDBNavLink to= "/">
                    <img 
                    src="/images/IMG-20200317-WA0134-removebg.png" 
                    className="icon-image" 
                    alt="aligment"
                    onClick={this.scrollToTop}
                    />
                  </MDBNavLink>
                </MDBNavbarBrand>
                <MDBNavbarToggler onClick={this.handleTogglerClick} />
                <MDBCollapse isOpen={this.state.collapsed} navbar>
                  <MDBNavbarNav left>
                  <MDBNavItem active>
                      <MDBNavLink 
                      to="/"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={500}
                      >Home</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                    <MDBNavLink 
                      to="#!"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={500}
                      >Diiscount</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                    <NavLink 
                      to="About"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={500}
                      >About US</NavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                    <Link 
                    to="contact" 
                    smooth={true} 
                    duration={500}
                    >Contact</Link>
                  </MDBNavItem>
                  </MDBNavbarNav>
                  <MDBNavbarNav right>
                    <MDBNavItem>
                    <MDBNavLink className="link-adjustment btn-empty" to="/SignIn">Sign In</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                    <MDBBtn className="btn-style">
                      Get In Touch
                    </MDBBtn>
                    </MDBNavItem>
                  </MDBNavbarNav>
                </MDBCollapse>
              </MDBContainer>
            </MDBNavbar>
            {this.state.collapsed && overlay}
          </div>
        )
    }
}
